import React, { Component } from 'react';
import './NewTodo.css';

class NewTodo extends Component {
  render() {
    return (
      <div className="row">
        <input type="text" id="add-item" placeholder="Add To-do" onClick={this.addItem}></input>
        <i className="far fa-plus-circle fa-clickable" id="add-item-button"></i>
      </div>
    );
  }
}

export default NewTodo;
